import React, {Component} from 'react';
import Table from "../Table";

const data = [
    {id: 1, name: 'Gob', value: '2'},
    {id: 2, name: 'Buster', value: '5'},
    {id: 3, name: 'George Michael', value: '4'}
];

class Observe extends Component {
    render() {
        return (
            <div>
                <Table data={data}/>
            </div>
        );
    }
}

export default Observe;
